import React from "react";

function ActionLink() {
  function handleClick(e) {
    alert("Clicked");
    window.open("https://www.google.com/", "_blank");
  }
}

function Toggle() {
  return (
    <a href="https://www.google.com/" target="_blank">
      <div class="toggle" onClick={ActionLink}>
        {" "}
        {/* position: relative */}
        <input type="checkbox" name="" onClick={ActionLink}></input>
        <span class="text-label">
          {" "}
          {/* position: absolute */}
          Register Here
        </span>
      </div>
    </a>
  );
}

export default Toggle;
